import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="400"
      height="300"
      viewBox="0 0 400 300"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      style={{ filter: 'blur(48px)' }}
    >
      {/* Large ellipse anchored at the corner */}
      <ellipse cx="0" cy="300" rx="260" ry="180" fill="#fff" fillOpacity="0.22" />
      <ellipse cx="60" cy="240" rx="120" ry="80" fill="#fff" fillOpacity="0.13" />
      <ellipse cx="120" cy="200" rx="80" ry="60" fill="#fff" fillOpacity="0.09" />
    </svg>
  );
}
